import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Bandeau from './components/Bandeau';
import Footer from './components/Footer';

import Cards from './components/News';

class App extends Component {
  render() {
    return (
      <div className="App">
        <Bandeau/>
        <Cards />
        <Footer />
      </div>
    );
  }
}

export default App;
